import React, {  } from 'react';

import styles from './LandingPage.module.css';


const Landing = () =>  { 
    const onScrollHandler = () => {
     console.log ('scrooooll');
        let win = window.scroll(() => {
            if(win.screenTop() > 20) {
                document.body.classList.add('blackish');
                console.log('waaaaaaaaaaaaaaaaasa');
            }   
        });
    }

    return (                   
        <div className={styles.landingGrid} onScroll={() => onScrollHandler()}>              
                <div className={styles.picContainer}></div>
                <span className={styles.author}>Sarmun Bustillo</span>
                <div className={styles.bannerText}>
                    <h1>Junior Web Developer</h1>
                    <hr/>
                    <p>HTML/CSS | JavaScript | React</p>                           
                    <div className={styles.socialLinks}>
                        <a href="https://github.com/Sarmunbustillo" rel="noopener noreferrer" target="_blank">
                            <i className="fa fa-github-square"  aria-hidden="true" />
                        </a>                                
                    </div>
                </div>                   
        </div>                      
    );    
};


export default Landing;
